public class CountStepsNotCompletedService { 

 public static Outputs count(PagingBy application, String stageName, Integer cacheKeyForGetSteps, Account candidate) {
 hasCatSteps = true;

 // Incomplete
 if (asr.ApplicationStage__c == 'BR' || asr.ApplicationStage__c == 'CAT') {
 hasIncompleteRegCatSteps = true;
 }

 // Waiting for Grading
 else if (asr.ApplicationStage__c == 'BR' || asr.ApplicationStage__c == 'CAT') {
 hasWaitingForGradingRegCatSteps = true;
 }

 // Failed
 else if (asr.ApplicationStage__c == 'BR' || asr.ApplicationStage__c == 'CAT') {
 hasFailedRegCatSteps = true;
 }
 }
}
